schemaDefinition: "create or replace view SN_SUBPRODUCTS(\n\tSTATE_CODE,\n\tORGANIZATION_ID_NAME,\n\
  \tVERSION_NUMBER,\n\tOPPORTUNITY_SUBPRODUCT_NAME,\n\tSURF_PRODUCT_SYS_ID,\n\tSN_IS_DEFAULT,\n\
  \tMODIFIED_ON_BEHALF_BY_NAME,\n\tSN_IS_DEFAULT_NAME,\n\tSN_REQUIRED_NAME,\n\tCREATED_BY,\n\
  \tMODIFIED_BY_YOMI_NAME,\n\tOPPORTUNITY_PARENT_PRODUCT,\n\tOPPORTUNITY_PARENT_PRODUCT_NAME,\n\
  \tSTATUS_CODE,\n\tMODIFIED_BY_NAME,\n\tSTATUS_CODE_NAME,\n\tUTC_CONVERSION_TIMEZONE_CODE,\n\
  \tOPPORTUNITY_SUBPRODUCT_CODE,\n\tCREATED_ON_BEHALF_BY_NAME,\n\tMODIFIED_ON_BEHALF_BY_YOMI_NAME,\n\
  \tMODIFIED_ON_BEHALF_BY,\n\tMODIFIED_BY,\n\tIMPORT_SEQUENCE_NUMBER,\n\tTIMEZONE_RULE_VERSION_NUMBER,\n\
  \tMODIFIED_ON,\n\tSTATE_CODE_NAME,\n\tOPPORTUNITY_SUBPRODUCT_ID,\n\tCREATED_ON,\n\
  \tCREATED_ON_BEHALF_BY,\n\tCREATED_BY_YOMI_NAME,\n\tSN_REQUIRED,\n\tCREATED_BY_NAME,\n\
  \tORGANIZATION_ID,\n\tCREATED_ON_BEHALF_BY_YOMI_NAME,\n\tOVERRIDDEN_CREATED_ON,\n\
  \tETL_INSERT_DATE,\n\tETL_UPDATE_DATE\n) as\nSELECT\n    STATECODE AS state_code,\n\
  \    ORGANIZATIONIDNAME AS organization_id_name,\n    VERSIONNUMBER AS version_number,\n\
  \    SN_NAME AS opportunity_subproduct_name,\n    --EXCHANGERATE AS exchange_rate,\n\
  \    SN_SURFSYSID AS surf_product_sys_id,\n    SN_ISDEFAULT AS sn_is_default,\n\
  \    MODIFIEDONBEHALFBYNAME AS modified_on_behalf_by_name,\n    SN_ISDEFAULTNAME\
  \ AS sn_is_default_name,\n    SN_REQUIREDNAME AS sn_required_name,\n    CREATEDBY\
  \ AS created_by,\n    MODIFIEDBYYOMINAME AS modified_by_yomi_name,\n    SN_PARENTPRODUCT\
  \ AS opportunity_parent_product,\n    SN_PARENTPRODUCTNAME AS opportunity_parent_product_name,\n\
  \    --SN_AMOUNT_BASE AS amount_base,\n    STATUSCODE AS status_code,\n    --SN_AMOUNT\
  \ AS sn_amount,\n    MODIFIEDBYNAME AS modified_by_name,\n    STATUSCODENAME AS\
  \ status_code_name,\n    UTCCONVERSIONTIMEZONECODE AS utc_conversion_timezone_code,\n\
  \    SN_SUBPRODUCTCODE AS opportunity_subproduct_code,\n    CREATEDONBEHALFBYNAME\
  \ AS created_on_behalf_by_name,\n    MODIFIEDONBEHALFBYYOMINAME AS modified_on_behalf_by_yomi_name,\n\
  \    MODIFIEDONBEHALFBY AS modified_on_behalf_by,\n    MODIFIEDBY AS modified_by,\n\
  \    IMPORTSEQUENCENUMBER AS import_sequence_number,\n    TIMEZONERULEVERSIONNUMBER\
  \ AS timezone_rule_version_number,\n    MODIFIEDON AS modified_on,\n    STATECODENAME\
  \ AS state_code_name,\n    SN_SUBPRODUCTID AS opportunity_subproduct_id,\n    --TRANSACTIONCURRENCYID\
  \ AS transaction_currency_id,\n    CREATEDON AS created_on,\n    CREATEDONBEHALFBY\
  \ AS created_on_behalf_by,\n    --TRANSACTIONCURRENCYIDNAME AS transaction_currency_id_name,\n\
  \    CREATEDBYYOMINAME AS created_by_yomi_name,\n    SN_REQUIRED AS sn_required,\n\
  \    CREATEDBYNAME AS created_by_name,\n    ORGANIZATIONID AS organization_id,\n\
  \    CREATEDONBEHALFBYYOMINAME AS created_on_behalf_by_yomi_name,\n    OVERRIDDENCREATEDON\
  \ AS overridden_created_on,\n    ETL_INSERT_DATE AS etl_insert_date,\n    ETL_UPDATE_DATE\
  \ AS etl_update_date\nFROM RDS.DYNAMICS365.SN_SUBPRODUCTS;"
